import React, { Component } from "react";
import {
  Text,
  View,
  ScrollView,
  StyleSheet,
  TextInput,
  ImageBackground,
  Dimensions,
  CheckBox,
  Image,
  Modal,
  TouchableOpacity,
} from "react-native";
import { FontAwesome5 } from "@expo/vector-icons";

export default class CroporFieldEventView extends Component {
  constructor(props) {
    super(props);

    this.state = {
      modalState: false,
      modalStateDelete: false,
    };
  }
  managetrash = () => {
    console.log("modalstate : " + this.state.modalState);

    if (this.state.modalState === true) {
      this.setState({
        modalState: false,
      });
    } else if (this.state.modalState === false) {
      this.setState({
        modalState: true,
      });
    }
  };

  managetrashdelete = () => {
    console.log("modalstate : " + this.state.modalState);

    this.setState({
      modalState: false,
      modalStateDelete: true,
    });
  };

  render() {
    let screenwidth = Dimensions.get("window").width;
    let screeheight = Dimensions.get("window").height;
    return (
      // <ImageBackground
      //   source={require("../../assets/background.png")}
      //   style={{ height: " 100%", width: "100%" }}
      // >
      <View style={{ flex: 1 }}>
        <View style={{ flex: 1.5 }}>
          <View
            style={{
              flex: 1,
              backgroundColor: "#0E6655",
              flexDirection: "row",
            }}
          >
            <View
              style={{
                flex: 1,
                // backgroundColor: "green",
                marginLeft: 20,
              }}
            >
              <TouchableOpacity
                onPress={() => {
                  this.props.navigation.openDrawer();
                }}
                style={{ marginTop: 30 }}
              >
                <FontAwesome5
                  name="bars"
                  size={24}
                  color="#000000"
                ></FontAwesome5>
              </TouchableOpacity>
            </View>
            <View
              style={{
                flex: 4,
                // backgroundColor: "purple",
                alignItems: "center",
              }}
            >
              <Text
                style={{
                  fontSize: 22,
                  color: "white",
                  marginTop: 30,

                  fontWeight: "bold",
                }}
              >
                Land & Crop Manager
              </Text>
            </View>
            <View
              style={{
                flex: 1,
                // backgroundColor: "pink",
              }}
            ></View>
          </View>

          <View
            style={{
              flex: 1,
              // backgroundColor: "#689F38",
              flexDirection: "row",
            }}
          >
            <View
              style={{
                flex: 3,
                // backgroundColor: "#689F38",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              <Text
                style={{
                  fontSize: 22,
                  color: "#0E6655",
                  fontWeight: "bold",
                  marginLeft: 20,
                }}
              >
                Crop or Field Event
              </Text>
            </View>

            <View
              style={{
                flex: 1.5,
                // backgroundColor: "#689F38",
                alignContent: "center",
                justifyContent: "center",
              }}
            >
              <View
                style={{
                  justifyContent: "center",
                  alignItems: "center",
                  flexDirection: "row",
                  borderRadius: 30,
                }}
              >
                <TouchableOpacity style={{ flexDirection: "row" }}>
                  <View style={{ paddingRight: 10 }}>
                    <Image
                      source={require("../../assets/add.png")}
                      style={{ height: 30, width: 10, paddingRight: 30 }}
                    />
                  </View>
                  <Text style={{ fontSize: 20, fontWeight: "bold" }}>ADD</Text>
                </TouchableOpacity>
              </View>
            </View>
          </View>
          <View
            style={{
              flex: 1,
              // backgroundColor: "#CDDC39",
              flexDirection: "row",
            }}
          >
            <View style={{ flex: 1 }}>
              <TextInput
                onFocus={this.onFocus}
                autoFocus={false}
                placeholder="sample"
                style={styles.textInput}
                placeholderTextColor="#9E9E9E"
              />
              <View
                style={{
                  position: "absolute",
                  right: 0,
                  top: 15,
                  left: 242,
                }}
              >
                <TouchableOpacity>
                  <View
                    style={{
                      width: 150,
                      backgroundColor: "#0E6655",
                      height: 50,
                      alignItems: "center",
                      justifyContent: "center",
                      borderRadius: 30,
                    }}
                  >
                    <Text
                      style={{
                        fontSize: 16,
                        fontWeight: "bold",
                        color: "white",
                      }}
                    >
                      Search
                    </Text>
                  </View>
                </TouchableOpacity>
              </View>
            </View>
          </View>
          <View
            style={{
              flex: 1,
              // backgroundColor: "#CDDC39",
              flexDirection: "row",
            }}
          >
            <View
              style={{
                flex: 3,
                // backgroundColor: "#CDDC39",
                flexDirection: "row",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <View>
                <Text style={{ fontSize: 16 }}>Items Selected</Text>
              </View>
              <View style={{ marginLeft: 5 }}>
                <CheckBox style={{ color: "#689F38" }}></CheckBox>
              </View>
              <View>
                <CheckBox></CheckBox>
              </View>
            </View>
            <View
              style={{
                flex: 2,
                // backgroundColor: "#CDDC39",
                flexDirection: "row",
                marginHorizontal: 5,
              }}
            >
              <View
                style={{
                  backgroundColor: "#689F38",
                  flex: 1,
                  marginVertical: 8,
                  borderRadius: 10,
                  justifyContent: "center",
                }}
              >
                <TouchableOpacity
                  style={{
                    marginHorizontal: 10,
                    borderRadius: 10,
                    borderColor: "red",
                    alignContent: "center",
                    alignItems: "center",
                  }}
                >
                  <Text style={{ color: "#ffffff" }}>Send</Text>
                </TouchableOpacity>
              </View>
              <View
                style={{
                  backgroundColor: "#689F38",
                  flex: 1,
                  marginVertical: 8,
                  borderRadius: 10,
                  justifyContent: "center",
                  marginLeft: 5,
                  marginRight: 10,
                }}
              >
                <TouchableOpacity
                  style={{
                    marginHorizontal: 10,
                    borderRadius: 20,
                    borderColor: "red",
                    alignContent: "center",
                    alignItems: "center",
                  }}
                >
                  <Text style={{ color: "#ffffff" }}>Sort</Text>
                </TouchableOpacity>
              </View>
            </View>
          </View>
        </View>
        {/* Modals are in this section */}
        <View>
          <Modal transparent={true} visible={this.state.modalState}>
            <View
              style={{
                backgroundColor: "#000000aa",
                flex: 1,
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              <View
                style={{
                  backgroundColor: "#ffffff",
                  paddingVertical: 20,
                  borderTopColor: "black",
                  paddingHorizontal: 10,
                  borderRadius: 23,
                }}
              >
                <TouchableOpacity
                  onPress={() => {
                    this.setState({ modalState: false });
                  }}
                >
                  <View
                    style={{
                      flexDirection: "row",
                      height: 20,
                      width: 300,
                      alignItems: "center",
                      justifyContent: "center",
                    }}
                  >
                    <View
                      style={{
                        alignItems: "center",
                        justifyContent: "center",
                      }}
                    >
                      <Text
                        style={{
                          fontWeight: "bold",
                          fontSize: 18,
                          color: "#222222",
                        }}
                      >
                        Are you sure you want
                      </Text>
                      <Text
                        style={{
                          fontWeight: "bold",
                          fontSize: 18,
                          color: "#222222",
                        }}
                      >
                        to delete your record ?
                      </Text>
